INSERT INTO [dbo].[Skill] ([SkillId],[Label],[BusinessLineId],[Validated],[Created_Date],[CreatedById]) VALUES (756107,'Connaissance approfondie des systèmes d’exploitation suivants : Linux/Unix et Windows.  Connaissances des technologies Internet et de leurs architectures  Connaissance de la programmation  HTML, CSS, Javascript, Java  Connaissance sur SQL Server et le language SQL  Un réel intérêt et même une passion pour les technologies de l’IT  De fortes capacités d’analyse et de résolution pour traiter des problèmes complexes pour lesquels il faut penser différemment et s’adapter en permanence jusqu’à la résolution,  Des capacités d’auto-apprentissage rapide en se basant sur des documentations en anglais.   Un vrai sens de la relation et du service clients, et ce avec des interlocuteurs ayant des profils variés (techniques, fonctionnels),  Un anglais professionnel (écrit et parlé) pour être en mesure d’échanger quotidiennement avec nos homologues des autres filiales et des US,  Une expérience professionnelle de plusieurs années acquise auprès d’une SSII et au sein d’une DSI.',1,0,NULL,7271)
